import React from "react";
import { Card } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

export default function FreeLancerCard() {
  const styles_text = {
    color: "#fff",
    fontSize: "15px",
  };
  const styles_button = {};

  const navigate = useNavigate();
  return (
    <div
      style={{ width: "15rem", height: "20rem", backgroundColor: "#212121" }}
    >
      <div className="freelancer-photo">
        <img src="" alt="" />
      </div>
      <div className="freelancer-desc">
        <h5 style={styles_text}>FisrtName</h5>
        <h5 style={styles_text}> LastName</h5>
        <h5 style={styles_text}>Profession</h5>
      </div>
      <div>
        <button
          style={{
            color: "#fff",
            backgroundColor: "#27AE60",
            border: "none ",
            borderRadius: "5px",
            width: "auto",
            fontSize: "15px",
          }}
          onClick={() => {
            navigate("/details");
          }}
        >
          Learn more
        </button>
      </div>
    </div>
  );
}
